import { Router } from 'express';
const router = Router()

import * as productsCtrl from '../controllers/products.controller'
import validateToken from './validate-token';

router.post('/',productsCtrl.postProducts)

router.get('/',validateToken,productsCtrl.getProducts)

router.get('/:productId',productsCtrl.getProductById)

//router.post('/deleteProduct/:id',productsCtrl.deleteProducts)
router.post('/deleteProduct/:idproducts',productsCtrl.deleteProducts)

router.post('/updateProduct/:idproducts',productsCtrl.updateProduct);

export default router;

