import mysql from 'mysql';
import dao from '../DAO/products'

export const getProducts =async (req, res) => {

    await dao.getAllProductsDAO((Callback)=>{
        try {
            if (!Callback) throw new Err("Error")
            res.send({
                status: true,
                message: 'Se ha obtenido todos los productos exitosamente',
                data: Callback
            })
            
        }
        catch (Err) {
            res.send({
                status: false,
                message: 'No se ha podido obtener los productos'

            })   
        }
    })    
};



export const postProducts = (req, res) => {
    console.log("Si entraa")
    const products = {
        name : req.body.name,
        price : req.body.price,
        urlimg : req.body.urlimg
    }
    console.log(products)
    dao.postProductsDAO(products,(data)=>{
        res.send({
            status: true,
            message: 'Se creado exitosamente el producto',
            data: data
        })
   
    },err =>{
        res.send({
            status: false,
            message: 'error en la creación del producto',
            data: err
        })
    }
    )
};

export const deleteProducts = async(req, res) => {
    console.log("Si entra")
    await dao.deleteProductsDAO(req.params.idproducts,(data) => {
        try {
            if (!data) throw new Err("Error")
            res.send({
                status: true,
                message: 'Producto eliminado exitosamente',
                data: data
            })
        }
        catch (Err) {
            res.send({
                status: false,
                message: 'No se ha podido eliminar el producto',
                data: null
            })
        }
    })
};



export const getProductById =(req,res)=>{
    
}

export const updateProduct= (req,res)=>{
    const products = {
        name : req.body.name,
        price : req.body.price,
        urlimg : req.body.urlimg
    }
    
    dao.updateProductDAO(products, req.params.idproducts,(data)=> {
        try {
            if (!data) throw new Err("Error")
            res.send({
                status: true,
                message: 'Producto editado exitosamente',
                data: data
            })
        }
        catch (Err) {
            res.send({
                status: false,
                message: 'No se ha podido editar el producto',
                data: null
            })
        }
        
       
    })
}

