import conn from "../database"

module.exports = {
    getAllProductsDAO: (callback) => {
        let sql = 'SELECT * FROM products'
        conn.query(sql, (err, data) => {
            if (err) throw err
            console.log(err)

            if (data.length > 0)
                callback(data)
            else
                callback(null)
        })
    },

    postProductsDAO: (product,callback) => {
        let sql = 'INSERT INTO products set ?'
        conn.query(sql,product, (err, data) => {
            if(err)
                return null
            else
                callback(data)    
        })
    },

    deleteProductsDAO: (idproducts, callback) => {
        console.log("Metodo dao para eliminar")
        let sql = 'DELETE FROM products WHERE idproducts = ?'
        conn.query(sql, idproducts, (err, data) => {
            console.log(err);
            if (err)
                return callback(null)
            else
                return callback(data)
        })
    },

    updateProductDAO:(product,idproducts,callback)=>{
        console.log("Metodo UpdateDAO")
        let sql = 'UPDATE products SET ? WHERE idproducts= ?'
        conn.query(sql, [product, idproducts], function (err, data) {
            if (err) throw err;
            return callback(data);
        });
    },
    
}

